import '../styles/App.css'
import format from "date-fns/format";
import getDay from "date-fns/getDay";
import parse from "date-fns/parse";
import startOfWeek from "date-fns/startOfWeek";
import React, { useState } from "react";
import { Calendar, dateFnsLocalizer } from "react-big-calendar";
import "react-big-calendar/lib/css/react-big-calendar.css";
//import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
//import { toBeRequired } from '@testing-library/jest-dom/dist/matchers';
import styles from '../styles/Calendar2.module.css'

// https://www.youtube.com/watch?v=lyRP_D0qCfk&ab_channel=DarwinTech --> need to add packages from this vid

const locales = {
  "en-US": require("date-fns/locale/en-US"),
};
const localizer = dateFnsLocalizer({
  format,
  parse,
  startOfWeek,
  getDay,
  locales,
});

const events = [
  {
    title: "Test",
    start: "7/20/2022",
    end: "7/25/2022"
  }, 
  {
    title: "Test2",
    start: "7/20/2022",
    end: "7/25/2022"
  } 
];

export default function Calendars() {
  //const [newEvent, setNewEvent] = useState({ title: "", start: "", end: "" });

  //const [allEvents, setAllEvents] = useState(events);
  const [allEvents] = useState(events);

  /*
  function handleAddEvent() {
    setAllEvents([...allEvents, newEvent]);
  } 
  */

  console.log([events])

  let title = "test3"
  let start = "8/23/22"
  let end = "8/24/22"

  events.push({"title": title, start: start, end: end})

  console.log([events])

  return(
    <div className={styles.calendarWrapper}>

    <h1>Calendar</h1>
    {/* Sorry!! Gotta style the calendar part first
      <h2>Add New Event</h2>

      <div>
      <input 
        type="text" 
        placeholder="Add Title" 
        style={{ width: "20%", marginRight: "10px" }} 
        value={newEvent.title} 
        onChange={(e) => setNewEvent({ ...newEvent, title: e.target.value })} />

      <DatePicker 
        placeholderText="Start Date" 
        style={{ marginRight: "10px" }} selected={newEvent.start} 
        onChange={(start) => setNewEvent({ ...newEvent, start })} />

      <DatePicker 
        placeholderText="End Date" 
        selected={newEvent.end} 
        onChange={(end) => setNewEvent({ ...newEvent, end })} />
     
     <button 
      style={{ marginTop: "10px" }} 
      onClick={handleAddEvent}>
       Add Event
     </button>
      </div>
    */}

      <Calendar 
        localizer = {localizer} 
        events = {allEvents}
        startAccessor ="start" endAccessor="end" 
        style={{
          height:500, 
          margin:"50px"}}
      />
    </div>
  ) 
  // <h1 className='wait-times'>Calendar</h1>;
}

class CalendarClass extends React.Component {
  constructor(props) {
    super(props);

    this.state = { 
      user_id: '',
      ical_link: '',
      cal: []
    };

    this.handleSubmit = this.handleSubmit.bind(this);
    this.getCalendar = this.getCalendar.bind(this);
    this.ShowCalendar = this.ShowCalendar.bind(this);
  }

  componentDidMount() {
    const headers = {"Content-Type": "application/json"};

    if (localStorage.getItem('auth-token')) {
        headers["Authorization"] = localStorage.getItem('auth-token');
    }

    fetch('http://127.0.0.1:8000/connect/get_info/', { headers, })
        .then(response => response.json())
        .then((data) => {
          this.setState({user_id: data.id}, () => {
            //console.log()
            this.getCalendar()})
        })
    .catch(console.log)
  }

  handleSubmit() {
    const requestOptions = {
      method: 'POST',
      headers: { 'Content-Type': 'application/json', 'Authorization': localStorage.getItem('auth-token'),},
      body: JSON.stringify({ 
        ical_link: this.state.ical_link,})
    };
  
    fetch('http://127.0.0.1:8000/schedule/upload_schedule/', requestOptions)
      .then(response => response.json())
      /*
      .then((data) => {
        this.setState({ }, () => {
          console.log()})
      })
      */
      .catch(console.log)
  }

  getCalendar() {
    const headers = {"Content-Type": "application/json"};

    if (localStorage.getItem('auth-token')) {
        headers["Authorization"] = localStorage.getItem('auth-token');
    }

    fetch('http://127.0.0.1:8000/schedule/get_schedule/', { headers, })
        .then(response => response.json())
        .then((data) => {
          this.setState({cal: data}, () => {console.log(this.state.cal)})
        })
    .catch(console.log)
  }

  ShowCalendar({ cal }) {
    return(
      <div>
        {cal.map(e => 
        <div className={styles.eventWrapper}>
          <h1 className={styles.eventTitle}>Event: {e.event}</h1>
          <p className={styles.eventDescrip}>Description: {e.event}</p>
        </div>
        )}
      </div>
    )
  }

  render() {
    return(<>
      <LoggedInTester />
      { localStorage.getItem('auth-token') }
      <br /> <br />

      <label style={{color: 'white'}}>iCal Link</label>
      <br />

      <input 
      onChange={(event) => {
        this.setState({ ical_link: event.target.value })}}>
      </input>
      <br />

      <button onClick={this.handleSubmit}>Submit</button>
      <br />

      <this.ShowCalendar cal={this.state.cal}/>
      <br />
    </>)
  }
}
